import React, { useEffect, useRef, useState } from "react";
import '../styles/journey.css';

const Journey = () => {
  const [animationProgress, setAnimationProgress] = useState(0);
  const [isDragging, setIsDragging] = useState(false);
  const [isPlaying, setIsPlaying] = useState(true);
  const timelineRef = useRef(null);

  // Handle animation
  useEffect(() => {
    let interval;

    if (isPlaying) {
      interval = setInterval(() => {
        setAnimationProgress(prev => {
          if (prev >= 100) {
            clearInterval(interval);
            return 100;
          }
          return prev + 0.5;
        });
      }, 50);
    }

    return () => clearInterval(interval);
  }, [isPlaying]);

  // Handle drag events
  const handleMouseDown = () => {
    setIsDragging(true);
    setIsPlaying(false);
  };

  const handleMouseMove = (e) => {
    if (!isDragging || !timelineRef.current) return;

    const timelineRect = timelineRef.current.getBoundingClientRect();
    const relativeX = e.clientX - timelineRect.left;
    let progress = (relativeX / timelineRect.width) * 100;

    // Constrain progress between 0 and 100
    progress = Math.max(0, Math.min(100, progress));
    setAnimationProgress(progress);
  };

  const handleMouseUp = () => {
    setIsDragging(false);
  };

  // Handle touch events for mobile
  const handleTouchStart = () => {
    setIsDragging(true);
    setIsPlaying(false);
  };

  const handleTouchMove = (e) => {
    if (!isDragging || !timelineRef.current) return;

    const timelineRect = timelineRef.current.getBoundingClientRect();
    const touch = e.touches[0];
    const relativeX = touch.clientX - timelineRect.left;
    let progress = (relativeX / timelineRect.width) * 100;

    // Constrain progress between 0 and 100
    progress = Math.max(0, Math.min(100, progress));
    setAnimationProgress(progress);
  };

  const handleTouchEnd = () => {
    setIsDragging(false);
  };

  // Reset animation
  const resetAnimation = () => {
    setAnimationProgress(0);
    setIsPlaying(true);
  };

  const milestones = [
    { year: "1997", title: "Born", description: "Born -Started my journey" },
    { year: "2002", title: "Started School", description: "Class 1" },
    { year: "2014", title: "Completed secondary education", description: "Finished Class 10" },
    { year: "2016", title: "Completed higher secondary education", description: "Completed higher secondary education" },
    { year: "2016", title: "Started University", description: "Began Bachelor's degree" },
    { year: "2020", title: "Graduated University", description: "Completed Bachelor's degree" },
    { year: "2020", title: "Started Working", description: "Began professional career" },
    { year: "2022", title: "Started Master's", description: "Began postgraduate studies" },
    { year: "2023", title: "Working Again", description: "Returned to professional work" }
  ];

  // Calculate position on parabolic path
  const getPathPosition = (progress) => {
    const x = progress;
    // Create a more dramatic parabolic path with higher peaks and lower valleys
    const y = 50 + 40 * Math.sin(progress * 0.05) + 20 * Math.cos(progress * 0.1);
    return { x, y };
  };

  const beePosition = getPathPosition(animationProgress);

  return (
    <section className="journey-area" id="journey">
      <div className="container pt-5">
        <div className="row">
          <div className="col-lg-12 text-center services-title">
            <h1 className="text-uppercase title-text">My Journey</h1>
            <p className="para">
              Follow the bee along the path of my life's journey
            </p>
          </div>
        </div>

        <div className="controls">
          <button 
            className="control-btn" 
            onClick={() => setIsPlaying(!isPlaying)}
          >
            {isPlaying ? "Pause" : "Play"}
          </button>
          <button className="control-btn" onClick={resetAnimation}>
            Reset
          </button>
        </div>

        <div 
          className="journey-timeline" 
          ref={timelineRef}
          onMouseMove={handleMouseMove}
          onMouseUp={handleMouseUp}
          onMouseLeave={handleMouseUp}
          onTouchMove={handleTouchMove}
          onTouchEnd={handleTouchEnd}
        >
          <div className="parabolic-path-container">
            <svg className="parabolic-path" viewBox="0 0 100 100" preserveAspectRatio="none">
              <path 
                d="M 0,50 
                   C 10,10 20,90 30,50
                   C 40,10 50,90 60,50
                   C 70,10 80,90 90,50
                   C 95,30 100,70 100,50" 
                fill="none" 
                stroke="#ffcc00" 
                strokeWidth="4" 
                strokeDasharray="4,6"
                strokeLinecap="round"
              />
              <circle cx="0" cy="50" r="4" fill="#ffcc00" />
              <circle cx="100" cy="50" r="4" fill="#ffcc00" />
            </svg>

            <div 
              className="bee-container" 
              style={{ 
                left: `${beePosition.x}%`, 
                top: `${beePosition.y}%`,
                cursor: isDragging ? 'grabbing' : 'grab'
              }}
              onMouseDown={handleMouseDown}
              onTouchStart={handleTouchStart}
            >
              <div className="bee">
                <div className="bee-body">
                  <div className="bee-wing"></div>
                  <div className="bee-wing right"></div>
                </div>
              </div>
            </div>
          </div>

          <div className="milestones-container">
            {milestones.map((milestone, index) => {
              const position = getPathPosition((index / (milestones.length - 1)) * 100);
              return (
                <div 
                  key={index} 
                  className="milestone"
                  style={{ 
                    left: `${position.x}%`, 
                    top: `${position.y}%` 
                  }}
                >
                  <div className="milestone-marker">
                    <span className="milestone-year">{milestone.year}</span>
                  </div>
                  <div className="milestone-content always-visible">
                    <h4>{milestone.title}</h4>
                    <p>{milestone.description}</p>
                  </div>
                </div>
              );
            })}
          </div>
        </div>

        <div className="instructions">
          Drag the bee to move it along the timeline. Click play to resume automatic movement.
        </div>
      </div>
    </section>
  );
};

export default Journey;
